import{_ as n,c as s,o as e,ag as t}from"./chunks/framework.DPDPlp3K.js";const u=JSON.parse('{"title":"前端项目部署","description":"","frontmatter":{},"headers":[],"relativePath":"diary/前端项目部署（centos+Ubuntu）.md","filePath":"diary/前端项目部署（centos+Ubuntu）.md"}'),i={name:"diary/前端项目部署（centos+Ubuntu）.md"};function l(p,a,o,c,d,r){return e(),s("div",null,a[0]||(a[0]=[t(`<h1 id="前端项目部署" tabindex="-1">前端项目部署 <a class="header-anchor" href="#前端项目部署" aria-label="Permalink to &quot;前端项目部署&quot;">​</a></h1><h2 id="centos" tabindex="-1">centos <a class="header-anchor" href="#centos" aria-label="Permalink to &quot;centos&quot;">​</a></h2><p>copy 一下在<a href="https://github.com/gaga0714/stock_quant_frontend/tree/main?tab=readme-ov-file#%E6%9C%8D%E5%8A%A1%E5%99%A8aliyun%E5%89%8D%E7%AB%AF%E9%83%A8%E7%BD%B2-%EF%B8%8F" target="_blank" rel="noreferrer">stock_quant_frontend</a>上写的</p><h3 id="上传" tabindex="-1">上传 <a class="header-anchor" href="#上传" aria-label="Permalink to &quot;上传&quot;">​</a></h3><p>本地打包 dist 上传至服务器该目录下： <code>/home/html/</code>，我的命名是 stock_quant_frontend</p><h3 id="修改配置文件" tabindex="-1">修改配置文件 <a class="header-anchor" href="#修改配置文件" aria-label="Permalink to &quot;修改配置文件&quot;">​</a></h3><p>进入 nginx 配置目录：<code>cd /usr/local/nginx/conf/</code></p><p>打开配置文件：<code>nano nginx.conf</code></p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>server {</span></span>
<span class="line"><span>        listen       10014;</span></span>
<span class="line"><span>        server_name  localhost;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>        location / {</span></span>
<span class="line"><span>                root        /home/html/stock_quant_frontend/;</span></span>
<span class="line"><span>                try_files   $uri $uri/ /index.html;</span></span>
<span class="line"><span>                index       index.html;</span></span>
<span class="line"><span>        }</span></span>
<span class="line"><span>}</span></span></code></pre></div><h3 id="重启-nginx-服务" tabindex="-1">重启 nginx 服务 <a class="header-anchor" href="#重启-nginx-服务" aria-label="Permalink to &quot;重启 nginx 服务&quot;">​</a></h3><p><code>cd /usr/local/nginx/sbin/</code></p><p><code>./nginx -s stop</code></p><p><code>./nginx</code></p><h2 id="ubuntu" tabindex="-1">Ubuntu <a class="header-anchor" href="#ubuntu" aria-label="Permalink to &quot;Ubuntu&quot;">​</a></h2><h3 id="上传-1" tabindex="-1">上传 <a class="header-anchor" href="#上传-1" aria-label="Permalink to &quot;上传&quot;">​</a></h3><p>放在/home/html/下</p><h3 id="写配置文件" tabindex="-1">写配置文件 <a class="header-anchor" href="#写配置文件" aria-label="Permalink to &quot;写配置文件&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>sudo nano /etc/nginx/sites-available/配置文件名</span></span></code></pre></div><p>举例：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>server {</span></span>
<span class="line"><span>    listen 10002;</span></span>
<span class="line"><span>    server_name localhost;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>    root /home/html/quant;</span></span>
<span class="line"><span>    index index.html;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>    location / {</span></span>
<span class="line"><span>        try_files $uri $uri/ =404;</span></span>
<span class="line"><span>    }</span></span>
<span class="line"><span>}</span></span></code></pre></div><h3 id="添加软链接" tabindex="-1">添加软链接 <a class="header-anchor" href="#添加软链接" aria-label="Permalink to &quot;添加软链接&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>sudo ln -s /etc/nginx/sites-available/quant /etc/nginx/sites-enabled/</span></span></code></pre></div><p><code>/etc/nginx/sites-available/</code> 存放所有站点配置（包括启用和未启用的） <code>/etc/nginx/sites-enabled/</code> 只存放当前启用中的站点配置，是软链接指向上面的文件</p><p>解释：</p><ul><li><p><code>ln</code>: Linux 的 link 命令，用来创建链接文件</p></li><li><p><code>-s</code>: 表示创建软链接（symbolic link）</p></li><li><p><code>/etc/nginx/sites-available/my-web</code>: 你新建的 Nginx 站点配置文件</p></li><li><p><code>/etc/nginx/sites-enabled/</code>: 是 Nginx 会读取启用站点配置的目录</p></li></ul><h3 id="检查语法错误" tabindex="-1">检查语法错误 <a class="header-anchor" href="#检查语法错误" aria-label="Permalink to &quot;检查语法错误&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>sudo nginx -t</span></span></code></pre></div><h3 id="重启" tabindex="-1">重启 <a class="header-anchor" href="#重启" aria-label="Permalink to &quot;重启&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>sudo systemctl restart nginx</span></span></code></pre></div>`,29)]))}const b=n(i,[["render",l]]);export{u as __pageData,b as default};
